package net.jeeshop.services.common;import java.io.Serializable;import net.jeeshop.core.dao.page.PagerModel;public class Keyvalue extends PagerModel implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String key1;	private String value;    private String p_code;    private String remark;	public void clear() {		super.clear();		id = null;		key1 = null;		value = null;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getKey1() {		return key1;	}	public void setKey1(String key1) {		this.key1 = key1;	}	public String getValue() {		return value;	}	public void setValue(String value) {		this.value = value;	}	public String getP_code() {		return p_code;	}	public void setP_code(String p_code) {		this.p_code = p_code;	}	public String getRemark() {		return remark;	}	public void setRemark(String remark) {		this.remark = remark;	}}